import React from 'react';
import { NavLink } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="bg-primary text-white h-screen w-64 fixed left-0 shadow-lg">
      <div className="p-5 flex justify-center">
        <img 
          src="/bits logo.png" 
          alt="BITS Pilani Logo" 
          className="w-32 h-auto"
        />
      </div>
      <nav className="mt-8">
        <ul className="space-y-2 px-4">
          <li>
            <NavLink 
              to="/" 
              className={({ isActive }) => 
                `block py-2 px-4 rounded transition duration-200 ${
                  isActive ? 'bg-white bg-opacity-20' : 'hover:bg-white hover:bg-opacity-10'
                }`
              }
            >
              Home
            </NavLink>
          </li>
          <li>
            <NavLink 
              to="/registration" 
              className={({ isActive }) => 
                `block py-2 px-4 rounded transition duration-200 ${
                  isActive ? 'bg-white bg-opacity-20' : 'hover:bg-white hover:bg-opacity-10'
                }`
              }
            >
              Registration
            </NavLink>
          </li>
          <li>
            <NavLink 
              to="/fixtures" 
              className={({ isActive }) => 
                `block py-2 px-4 rounded transition duration-200 ${
                  isActive ? 'bg-white bg-opacity-20' : 'hover:bg-white hover:bg-opacity-10'
                }`
              }
            >
              Fixtures
            </NavLink>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Sidebar;
